        #region EventHandlers

        private void btnPosition_Click(object sender, EventArgs e)
        {
            System.Collections.Specialized.HybridDictionary dic = new System.Collections.Specialized.HybridDictionary() { { "ClassName", "FrmFall" },
                { "BaPersonID", qryQuery["FallBaPersonID"] }, {"ModulID", 3},
                {"TreeNodeID", string.Format("CtlIkLeistungAlbv{0}\\Schuldner", qryQuery["FaLeistungID"])},
                {"ActiveSQLQuery.Find", string.Format("KbBuchungID = {0}", qryQuery["KbBuchungID"])}};

            bool result = FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
            // resultat ist eigentlich immer true
            if (!result)
            {
                KissMsg.ShowInfo("Die Position befindet sich in einem abgeschlossenen W. Deaktivieren Sie die Optionen 'Abgeschlossene W ausblenden' um die Position anzuzeigen.");
                dic = new System.Collections.Specialized.HybridDictionary() { { "ClassName", "FrmFall" }, { "BaPersonID", qryQuery["FallBaPersonID"] },
                    {"ModulID", 3}, {"TreeNodeID", "CtlWhKontoauszug"}};
                FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
            }
        }

        private void edtDatumsart_EditValueChanged(object sender, EventArgs e)
        {
            qryForderungStatus.Fill(edtDatumsart.EditValue);
            edtForderungStatus.Properties.DropDownRows = qryForderungStatus.Count;
            if (DBUtil.IsEmpty(edtForderungStatus.EditValue))
            {
                edtForderungStatus.EditValue = "b";
            }
        }

        private void qryQuery_AfterFill(object sender, EventArgs e)
        {
            if (edtDatumsart.EditValue.Equals("z") && !DBUtil.IsEmpty(edtForderungStatus.EditValue) && edtForderungStatus.EditValue.Equals("b"))
            {
                DataSet ds = qryQuery.DataSet;
                ds.Relations.Add("LevelDetail",
                    new DataColumn[] { ds.Tables[0].Columns[KiSS.DBScheme.DBO.KbBuchung.KbBuchungID] },
                    new DataColumn[] { ds.Tables[1].Columns[KiSS.DBScheme.DBO.KbBuchung.KbBuchungID] });
            }
        }

