        #region Methods

        #region Public Methods

        public override void OnSearch()
        {
            base.OnSearch();
        }

        #endregion

        #region Protected Methods

        protected override void NewSearch()
        {
            edtDatumsart.EditValue = "s";
            edtForderungStatus.EditValue = "o";
            edtInkassoStatus.EditValue = 1;
            edtUser.LookupID = Session.User.UserID;

            edtUser.EditValue = DBUtil.ExecuteScalarSQL("SELECT NameVorname FROM dbo.vwUser WHERE UserID = {0}", Session.User.UserID);

            base.NewSearch();
        }

        protected override void OnLoad(EventArgs e)
        {
            base.OnLoad(e);
            edtDatumsart.LoadQuery(qryDatumsart, "value", "datumsart");
            edtForderungsart.LoadQuery(qryForderungsart, "value", "forderungsart");
            edtForderungStatus.LoadQuery(qryForderungStatus, "value", "status");
            edtInkassoStatus.LoadQuery(qryInkassoStatus, "value", "status");
        }

        protected override void RunSearch()
        {
            qryQuery.DataTable.Constraints.Clear();
            colBetragZE.Visible = edtDatumsart.EditValue.Equals("z");
            if (edtDatumsart.EditValue.Equals("z") && (DBUtil.IsEmpty(edtDatumVon.EditValue) || DBUtil.IsEmpty(edtDatumBis.EditValue)))
            {
                KissMsg.ShowInfo(this.Name, "LeereFelderDatumVonBis", "Die Felder 'Datum Von' und 'Datum Bis' müssen ausgefüllt sein.");
                throw new KissCancelException();
            }
            base.RunSearch();
        }

